package com.ms.mat223unc.main;

public class Calculator2 {
private double inch;
private double peng;
private double ff;
private double mih;
private double result;
private String area;
public Calculator2() {
	// TODO Auto-generated constructor stub
}
public Calculator2(double inch, double peng, double ff, double mih, double result, String area) {
	super();
	this.inch = inch;
	this.peng = peng;
	this.ff = ff;
	this.mih = mih;
	this.result = result;
	this.area = area;
}
public double getInch() {
	return inch;
}
public void setInch(double inch) {
	this.inch = inch;
}
public double getPeng() {
	return peng;
}
public void setPeng(double peng) {
	this.peng = peng;
}
public double getFf() {
	return ff;
}
public void setFf(double ff) {
	this.ff = ff;
}
public double getMih() {
	return mih;
}
public void setMih(double mih) {
	this.mih = mih;
}
public double getResult() {
	return result;
}
public void setResult(double result) {
	this.result = result;
}
public String getArea() {
	return area;
}
public void setArea(String area) {
	this.area = area;
}







}